<div class="mover" style="top: 7980px;"></div>
<div class="mover" style="top: 7990px;"></div>
<script>
var movers = document.querySelectorAll('.mover');
(function init() {
    for (var m = 0; m < movers.length; m++) {
        movers[m].style.top = (m * 10) + 'px';
    }
})();
function update() {
    var scrollY = window.scrollY, mover = null, moverTop = [], halfWindowHeight = window.innerHeight * 0.5, offset = 0;
    for (var m = 0; m < movers.length; m++) {
        mover = movers[m];
        moverTop[m] = mover.offsetTop;
        if (scrollY > moverTop[m] - halfWindowHeight) {
            mover.classList.add('left');
        } else {
            mover.classList.remove('left');
        }
    }
    requestAnimFrame(update);
}
window.addEventListener('load', update, false);
window.requestAnimFrame = (function() {
    return window.requestAnimationFrame || window.webkitRequestAnimationFrame || window.mozRequestAnimationFrame || window.oRequestAnimationFrame || window.msRequestAnimationFrame || function(callback) {
        window.setTimeout(callback, 1000 / 60);
    };
})();
</script>

</body></html>
